(()=>{function s(){[...document.querySelectorAll("[tw-group]")].forEach(r=>{[...r.attributes].filter(t=>t.name.includes("tw-group.")).forEach(t=>{let l=t.name.split(".").filter(e=>e!=="tw-group");t.value.split(" ").forEach(e=>{l.forEach(o=>r.classList.add(`${o}:${e}`))})})})}window.twGroupClasses=s;})();
